/* model version */
#define NNOM_MODEL_VERSION (10000*0 + 100*4 + 3)

/* nnom model */
static nnom_model_t* nnom_model_create(void)
{
	static nnom_model_t model;
	nnom_layer_t* layer[14];

	check_model_version(NNOM_MODEL_VERSION);
	new_model(&model);

	layer[0] = input_s(&input_1_config);
	layer[1] = model.hook(conv2d_s(&conv2d_config), layer[0]);
	layer[2] = model.active(act_leaky_relu(0.200000f), layer[1]);
	layer[3] = model.active(act_relu(), layer[2]);
	layer[4] = model.hook(maxpool_s(&max_pooling2d_config), layer[3]);
	layer[5] = model.hook(conv2d_s(&conv2d_1_config), layer[4]);
	layer[6] = model.active(act_relu(), layer[5]);
	layer[7] = model.hook(maxpool_s(&max_pooling2d_1_config), layer[6]);
	layer[8] = model.hook(flatten_s(&flatten_config), layer[7]);
	layer[9] = model.hook(dense_s(&dense_config), layer[8]);
	layer[10] = model.hook(dense_s(&dense_1_config), layer[9]);
	layer[11] = model.hook(dense_s(&dense_2_config), layer[10]);
	layer[12] = model.hook(softmax_s(&softmax_config), layer[11]);
	layer[13] = model.hook(output_s(&output0_config), layer[12]);
	model_compile(&model, layer[0], layer[13]);
	return &model;
}
